import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import CreatePackage from './CreatePackage';
import ViewMyPackages from './ViewMyPackages'; // Asigură-te că importul este corect

const App = () => {
  return (
    <Router>
      <div>
        <h1 style={{ textAlign: 'center', color: '#d39db7' }}>Package Management</h1>
        <nav style={{ marginBottom: '20px', textAlign: 'center' }}>
          <ul style={{ listStyleType: 'none', padding: 0, display: 'flex', justifyContent: 'center', gap: '20px' }}>
            <li>
              <Link
                to="/create-package"
                style={{
                  textDecoration: 'none',
                  color: '#7d7d7d',
                  fontWeight: 'bold',
                  padding: '10px 20px',
                  borderRadius: '5px',
                  backgroundColor: '#fbeef0',
                  transition: 'background-color 0.3s',
                }}
              >
                Create Package
              </Link>
            </li>
            <li>
              <Link
                to="/view-my-packages"
                style={{
                  textDecoration: 'none',
                  color: '#7d7d7d',
                  fontWeight: 'bold',
                  padding: '10px 20px',
                  borderRadius: '5px',
                  backgroundColor: '#fbeef0',
                  transition: 'background-color 0.3s',
                }}
              >
                View My Packages
              </Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/create-package" element={<CreatePackage />} />
          <Route path="/view-my-packages" element={<ViewMyPackages />} /> {}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
